function App() {
  return (
    <>
    <BrowserRouter></BrowserRouter>
      <Header />
      <main className="my-3">
        <Container>
          <h1>Ecommerce App</h1>

          <Home />
        </Container>
      </main>
      <Footer />
    </>
  );
}

export default App;
